import React from 'react';
import imgURL from '../assets/picture/SignInLogo.png';
import '../assets/css/SignInLogo.css';
class Logo extends React.Component {
    render() {
        return (
            <div class="logo-slogan">
                <img class="sign-in-logo" src={imgURL}/>
                <h1 class="sign-in-to-om">登录系统</h1>
            </div>
        )
    }
}

export default Logo;
